(function () {
  function loadScript(src, onLoad) {
    var script = document.createElement("script");
    script.src = src;
    script.async = false;
    script.onload = onLoad;
    document.head.appendChild(script);
  }

  loadScript("https://cdn.webdatarocks.com/latest/webdatarocks.toolbar.min.js", function () {
    loadScript("https://cdn.webdatarocks.com/latest/webdatarocks.js", function () {
      window.__wdrReady = true;
    });
  });
})();
